import React from "react";

export default function Banner({ children, title, subtitle }) {
  return (
    <div className="col-md-12">
      <h1 className="col-md-6 text-center">{title}</h1>
      <div />
      <p>{subtitle}</p>
      {children}
    </div>
  );
}
